declarations.description:
Transforms a document's stylesheets' pseudo classes into normal classes with
a new stylesheet.

Pseudo classes are given an underscore in their transformation. For example,
`:hover` transforms to `._hover`.

```css
.mdc-foo:hover {
  color: teal;
}
```
```css
.mdc-foo._hover {
  color: teal;
}
```

